import{_ as a,o as e,c as r,N as t}from"./chunks/framework.28749716.js";const g=JSON.parse('{"title":"叮~","description":"","frontmatter":{},"headers":[],"relativePath":"column/Growing/index.md"}'),i={name:"column/Growing/index.md"},l=t('<h1 id="叮" tabindex="-1">叮~ <a class="header-anchor" href="#叮" aria-label="Permalink to &quot;叮~&quot;">​</a></h1><p>个人成长/所思所想,优势劣势，分析成长之路</p><h1 id="任务整理" tabindex="-1">任务整理 <a class="header-anchor" href="#任务整理" aria-label="Permalink to &quot;任务整理&quot;">​</a></h1><p><a href="https://www.msn.cn/zh-cn/gaming/other/%E8%85%90%E5%9B%A2%E5%84%BF%E6%9C%80%E6%96%A9%E7%94%B7cos%E7%9B%98%E7%82%B9-%E9%83%BD%E7%9C%8B%E8%BF%87%E7%9A%84%E6%97%A0%E6%95%8C%E4%BA%86-%E5%AE%85%E7%94%B7%E5%A5%B3%E7%A5%9E-%E5%90%8D%E4%B8%8D%E8%99%9A%E4%BC%A0/ar-AA1pv9fV?ocid=msedgntp&amp;pc=CNNDDB&amp;cvid=66ce7d83b60a493090cfd5e7b34ddbc4&amp;ei=22" target="_blank" rel="noreferrer">https://www.msn.cn/zh-cn/gaming/other/腐团儿最斩男cos盘点-都看过的无敌了-宅男女神-名不虚传/ar-AA1pv9fV?ocid=msedgntp&amp;pc=CNNDDB&amp;cvid=66ce7d83b60a493090cfd5e7b34ddbc4&amp;ei=22</a></p><h1 id="明天" tabindex="-1">明天 <a class="header-anchor" href="#明天" aria-label="Permalink to &quot;明天&quot;">​</a></h1><p>接着学 css 真得整理面试的东西了，然后就可以问 HR 问这啊问那的</p><h2 id="面试" tabindex="-1">面试 <a class="header-anchor" href="#面试" aria-label="Permalink to &quot;面试&quot;">​</a></h2><h3 id="面试-1" tabindex="-1">面试 <a class="header-anchor" href="#面试-1" aria-label="Permalink to &quot;面试&quot;">​</a></h3><h2 id="自我" tabindex="-1">自我 <a class="header-anchor" href="#自我" aria-label="Permalink to &quot;自我&quot;">​</a></h2><p>来自武汉，然后说之前是后端转前端，感谢提供的机会和桥梁，深知自己能力还存在不足，会接着打磨自己，，接收新事物能力强，熟练阅读官方文档和示例，具备较强的业务跟进能力、自学能力、实践能力、表达能力和团队协作能力。</p><p>优点:日报完成的好、项目完成得佳,接手同组实习生项目 能够保质保量，迅速的完成。团队交流能力强，和项目团队搭好关系</p><h3 id="项目" tabindex="-1">项目 <a class="header-anchor" href="#项目" aria-label="Permalink to &quot;项目&quot;">​</a></h3><p>2.总结实习内容，完善简历。</p><ul><li>人脸录入组件 二维码手机端电脑端通信方法，接口轮询，后端对接，团队沟通</li><li>OCR 组件、，web 屏幕截图技术，vue 自定义指令的应用，图片的拖拽、缩放，对应识别框的元素</li><li>彩虹客户端优化：electron、eletron-tabs、forge 打包，对操作系统底层 api 的熟悉</li><li>webrtc 一对多屏幕共享 websocket、webrtc 技术</li></ul><p>日报：持之以恒，协作能力，项目结合用户体验度的能力，</p><p>网页截屏中水印怎么解决？？？</p><h3 id="项目中遇到的困难怎么解决" tabindex="-1">项目中遇到的困难怎么解决 <a class="header-anchor" href="#项目中遇到的困难怎么解决" aria-label="Permalink to &quot;项目中遇到的困难怎么解决&quot;">​</a></h3><p>项目经历太少，处理异常退出，，，是由后端定时器去清理</p><p>github 写 issue，根据作者的回复解决</p><p>通过和指导人沟通实现方案，比如</p><p>换个思路，换种实现方案，一对一改一对多 换种网络架构，webrtc 技术，使用 SFU 服务器不对音视频进行编码、解码、混流等算力较高的工作，只负责转发媒体或者存储媒体，实际上就是一个音视频路由转发器。</p><p>查看现有项目的实现方案，扫码查询接口，轮询</p><p>爱好</p><p>自我介绍、爱好、个人魅力</p><p>写作，写博客记录分享技术和生活，篮球、唱歌、喜欢专研</p><p>特点</p><h3 id="待遇" tabindex="-1">待遇？？ <a class="header-anchor" href="#待遇" aria-label="Permalink to &quot;待遇？？&quot;">​</a></h3><h3 id="为什么不考研" tabindex="-1">为什么不考研？？？ <a class="header-anchor" href="#为什么不考研" aria-label="Permalink to &quot;为什么不考研？？？&quot;">​</a></h3><p>因为如果我选择考研也是为了更好地找工作，而现在已经有一个很好的机会和很好的平台了，所以就选择了直接来工作，将所学直接用于实践，在实践中历练，结识很多优秀的同事，提升自己的能力。</p><p>我想将</p><p>问他</p><p>后续的安排是怎么样的？？？ 我们是进业务组实习还是？？</p><p>薪资待遇如何？？？</p><h3 id="薪资范围-在项目里的定位和协作能力-个人对职业的看法-未来的期望和方向" tabindex="-1">薪资范围？？在项目里的定位和协作能力，个人对职业的看法，未来的期望和方向 <a class="header-anchor" href="#薪资范围-在项目里的定位和协作能力-个人对职业的看法-未来的期望和方向" aria-label="Permalink to &quot;薪资范围？？在项目里的定位和协作能力，个人对职业的看法，未来的期望和方向&quot;">​</a></h3><h3 id="用三个词形容一下自己" tabindex="-1">用三个词形容一下自己 <a class="header-anchor" href="#用三个词形容一下自己" aria-label="Permalink to &quot;用三个词形容一下自己&quot;">​</a></h3><ul><li><strong>**主动、具有规划**</strong>: 接到需求时，先分析可行性，技术方案，再去尝试，你能够主动分析任务需求，提前做好开发准备，展现出高度的主动性和积极性。</li><li><strong>**解决问题能力**</strong>: 在任务开始时，能迅速找出可行方案，具备良好的分析和解决问题的能力。例同组其他人的屏幕共享项目</li><li><strong>**执行力**</strong>: 你能够迅速将方案付诸实践，展现出强大的执行能力。</li><li>善于沟通、团队协作：会与后端、指导人进行对接，无论是遇到问题还是取得阶段成果，都会分享和讨论</li><li>高效</li></ul><h3 id="相关" tabindex="-1">相关 <a class="header-anchor" href="#相关" aria-label="Permalink to &quot;相关&quot;">​</a></h3><p>请问我们八月底结束实习后，后面的安排是什么呢？？？ 还能留下来吗？留下来做什么事情呢？？？【有工资吗？】 什么时候来什么时候走这样子呢？</p><p>请问什么时候开始面呀，什么顺序？？？</p><p>要问我们什么东西啊 想提前准备一下</p><h4 id="专业技能【前端】" tabindex="-1">专业技能【前端】 <a class="header-anchor" href="#专业技能【前端】" aria-label="Permalink to &quot;专业技能【前端】&quot;">​</a></h4><ul><li><strong>**HTML/CSS/JavaScript**</strong>: 熟练掌握，能够编写符合标准的前端页面，并具备良好的代码风格。</li><li><strong>**Vue.js**</strong>: 深入理解 Vue.js 框架，能够独立开发复杂的组件，并熟练使用 Vue Router 和 Vuex 进行状态管理。</li><li><strong>**Electron**</strong>: 熟悉桌面应用开发流程，能够使用 Electron 进行应用程序的开发、调试及打包。</li><li><strong>**WebRTC/WebSocket**</strong>: 掌握实时通信技术，能够实现屏幕共享等复杂功能。</li><li><strong>**API 对接**</strong>: 有丰富的前后端接口对接经验，熟悉 RESTful API 的设计与实现。</li><li><strong>**版本控制**</strong>: 熟练使用 Git 进行版本管理，能够使用 GitFlow 等工作流进行团队协作。</li></ul><h4 id="工作经历" tabindex="-1">工作经历 <a class="header-anchor" href="#工作经历" aria-label="Permalink to &quot;工作经历&quot;">​</a></h4><p><strong>**武汉金山办公软件有限公司 — 前端开发实习生**</strong></p><p><strong>2024 年 5 月 — 2024 年 8 月</strong></p><p>在前端开发业务组学习前端开发知识，熟悉开发产品的流程，并动手实践，完成指导老师发布的任务。提升了业务跟进能力、自学能力、实践能力、表达能力和团队协作能力。</p><h4 id="项目经历" tabindex="-1">项目经历 <a class="header-anchor" href="#项目经历" aria-label="Permalink to &quot;项目经历&quot;">​</a></h4><p><strong>**人脸录入组件开发**</strong></p><ul><li>设计并实现了一个基于 QR 码的手机端与电脑端通信方法，用于人脸录入。</li><li>通过接口轮询机制，实现了实时数据同步，并成功与后端服务进行无缝对接。</li><li>在项目开发过程中，积极与团队沟通，确保需求的准确实现和项目的顺利推进。</li></ul><p><strong>**OCR 组件开发与优化**</strong></p><ul><li>开发了一个 OCR 组件，支持 web 屏幕截图，使用 Vue.js 自定义指令处理图像的拖拽和缩放。</li><li>实现了识别框与图像元素的动态绑定，确保了 OCR 结果的精确展示。</li></ul><p><a href="https://github.com/weijun-lab/region-screenshot-js/issues/3" target="_blank" rel="noreferrer">截图工具 · Issue #3 · weijun-lab/region-screenshot-js (github.com)</a></p><p><a href="https://blog.csdn.net/sunny243788557/article/details/102460327" target="_blank" rel="noreferrer">前端 web 页面防截屏水印生成方案（网页水印+图片水印）_前端批图页面-CSDN 博客</a></p><p><a href="https://www.bing.com/search?q=%E7%BD%91%E9%A1%B5%E6%88%AA%E5%B1%8F%E6%80%8E%E4%B9%88%E4%B8%8D%E8%A6%81%E6%B0%B4%E5%8D%B0%EF%BC%9F%EF%BC%9F%EF%BC%9F%E4%B8%8D%E6%8A%8A%E6%B0%B4%E5%8D%B0%E6%88%AA%E8%BF%9B%E5%8E%BB&amp;form=ANNTH1&amp;refig=66c84d821e574781a78062782c85af0a&amp;pc=CNNDDB" target="_blank" rel="noreferrer">网页截屏怎么不要水印？？？不把水印截进去 - 搜索 (bing.com)</a></p><p><a href="https://cn.bing.com/search?pglt=169&amp;q=webrtc%E4%B8%80%E5%AF%B9%E5%A4%9A%E9%80%9A%E4%BF%A1&amp;cvid=495cf7ef41574e31bc98b43cd41ba31f&amp;gs_lcrp=EgZjaHJvbWUqBggDEAAYQDIGCAAQRRg5MgYIARAAGEAyBggCEAAYQDIGCAMQABhAMgYIBBAAGEAyBggFEAAYQDIGCAYQABhA0gEJMTI2OTJqMGoxqAIAsAIA&amp;PC=HCTS&amp;FPIG=0BCD90688FB648FCBE3A362C860179F1&amp;first=6&amp;FORM=PERE" target="_blank" rel="noreferrer">webrtc 一对多通信 - 搜索 (bing.com)</a></p><p><strong>**彩虹客户端优化**</strong></p><ul><li>参与了 Electron 客户端的优化工作，熟悉 electron-tabs 和 forge 打包流程。</li><li>深入理解操作系统底层 API，优化了客户端的性能和用户体验。</li></ul><p><strong>**WebRTC 屏幕共享功能开发**</strong></p><ul><li>负责实现一对多的屏幕共享功能，运用了 WebSocket 和 WebRTC 技术。</li><li>通过深入研究官方文档，成功解决了开发中的多个技术难题。</li></ul><h2 id="毕设的" tabindex="-1">毕设的 <a class="header-anchor" href="#毕设的" aria-label="Permalink to &quot;毕设的&quot;">​</a></h2><p>问一下老哥 整理代码</p><h1 id="css-学习" tabindex="-1">css 学习 <a class="header-anchor" href="#css-学习" aria-label="Permalink to &quot;css 学习&quot;">​</a></h1><p>关键，布局【将盒子摆到相应位置 】，各种单位</p><h3 id="通配符-选所有标签-清除默认样式-color-文字颜色" tabindex="-1">通配符 选所有标签（清除默认样式） color：文字颜色？ <a class="header-anchor" href="#通配符-选所有标签-清除默认样式-color-文字颜色" aria-label="Permalink to &quot;通配符 选所有标签（清除默认样式） color：文字颜色？&quot;">​</a></h3><p>p35 文字修饰 lineheight 取值，数字和单位 css 所有单位。。。行高的范围， 单行文字垂直居中。 行高的使用 text-indent 首行缩进 ，2em text-align 文本对齐，调整内容对齐方式，标签并没改变，本质是内容居中，包括可以让标签里的图片水平居中.给父级添加 text-align:center; 行内块元素会水平会居中 color 的书写方式，跟 bgc 区别 rgba 透明色 复合和伪类选择器（选状态）</p><p>继承性：文字控制属性，会被继承。 层叠性：相同属性后覆盖前，不同属性叠加 优先级：计算方式，多重叠加，父类继承计算。</p><h2 id="学习之路" tabindex="-1">学习之路 <a class="header-anchor" href="#学习之路" aria-label="Permalink to &quot;学习之路&quot;">​</a></h2><h3 id="前端之路" tabindex="-1">前端之路 <a class="header-anchor" href="#前端之路" aria-label="Permalink to &quot;前端之路&quot;">​</a></h3><h4 id="css" tabindex="-1">css <a class="header-anchor" href="#css" aria-label="Permalink to &quot;css&quot;">​</a></h4><h4 id="项目实战" tabindex="-1">项目实战 <a class="header-anchor" href="#项目实战" aria-label="Permalink to &quot;项目实战&quot;">​</a></h4><p><a href="https://www.bilibili.com/video/BV14z4y1N7pg/?p=17" target="_blank" rel="noreferrer">实战篇-05<em>登录主逻辑</em>哔哩哔哩_bilibili</a></p><p><a href="https://www.bilibili.com/video/BV1Ga4y1S7jc/" target="_blank" rel="noreferrer">【黑马程序员课程点评】四天肝完黑马 spring3+vue3 的课程，我收获了什么？_哔哩哔哩_bilibili</a></p><p><a href="https://gitee.com/zyfstart/big-event" target="_blank" rel="noreferrer">big-event: 黑马大事件项目 (gitee.com)</a></p>',73),o=[l];function n(s,h,c,p,d,b){return e(),r("div",null,o)}const m=a(i,[["render",n]]);export{g as __pageData,m as default};
